window.bookSummaryJSON = "<p>Justice expects to meet a naïve college man but instead meets a man who is a natural born boss. From the start, things go sour and she starts to wonder if she can even do business with him at all. Besides the sexual tension between the two, their attitudes clash, and things unravel fast. Not the one to let a bit of attitude get in the way of business, Zahir doesn’t let Justice faze him. After finding his girlfriend Stacey in a compromising position, he cuts all ties with her and moves on, ready to focus on his business ventures. He’s attracted to Justice, but unlike her, he’s down for whatever and not afraid to mix business with pleasure.</p> <p>Lola has had a hard life, and after getting out of the foster care system she became a free spirit. She lives life freely, without a care in the world, and has to worry only about herself. When her past shows up on her doorstep in the form of an eight-year-old girl, she now has to face everything she’s been running away from.</p> <p>Justice just wants to do business and keep her feelings out of it, but will she be able to? Will she and Zahir end up becoming more than business associates since they are now both single? Lola has never had to be responsible before. Will she be able to take care of a little girl? Or will she send her back to the foster home she came from?</p>"; 
